import {
  Form,
  Input,
  Button
} from 'antd';
import React from 'react';
import './index.css'
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
export default function Register() {
  const navigate = useNavigate();
  const back = () => {
    navigate(-1);
  }
  const onFinish = (values) => {
    const { username, password } = values;
    axios({
      method: 'POST',
      url: 'http://39.98.41.126:31104/users',
      data: JSON.stringify({
        username: values.username,
        password: values.password
      })
    }).then(
      response => { alert('注册成功！'); console.log(response); back(); },
    )
    console.log('Received values of form: ', values);
  };
  return (
    <div className='dlzc-mask'>
      <div className='dlzc-register'>
        <div className='dlzc-registerName'>用户注册
          <button className='dlzc-cancelBtn' onClick={back} style={{ background: '#3D6DB5', border: 'none' }}>X</button>
        </div>
        <div className='dlzc-fix'>
          <Form
            name="register"
            onFinish={onFinish}>
            <Form.Item
              name="username"
              label="Username"
              rules={[
                {
                  pattern: "^[\\u4e00-\\u9fa5a-zA-Z0-9]{6,12}$",
                  message: '用户名必须为6-12位字母/数字/中文'
                },
                {
                  required: true,
                  message: 'Please input your Username',
                },
              ]}
            >
              <Input />
            </Form.Item>
            <Form.Item
              name="password"
              label="Password"
              rules={[
                {
                  required: true,
                  message: 'Please input your password!',
                },
                {
                  pattern: "^(?=.*\\d)(?=.*[a-z])(?=.*[A-Z]).{6,20}$",
                  message: '密码必须为6-20个字母、数字'

                }
              ]}
              hasFeedback
            >
              <Input.Password />
            </Form.Item>

            <Form.Item
              name="confirm"
              label="Confirm Password"
              dependencies={['password']}
              hasFeedback
              rules={[
                {
                  required: true,
                  message: 'Please confirm your password!',
                },
                ({ getFieldValue }) => ({
                  validator(_, value) {
                    if (!value || getFieldValue('password') === value) {
                      return Promise.resolve();
                    }

                    return Promise.reject(new Error('The two passwords that you entered do not match!'));
                  },
                }),
              ]}
            >
              <Input.Password />
            </Form.Item>
            <Form.Item >
              <Button type="primary" style={{ position: 'absolute', left: '50%', top: '60%', transform: 'translateX(-50%)' }} htmlType="submit">
                Register
              </Button>
            </Form.Item>
          </Form>
        </div>
      </div>
    </div>

  )
}
